import React , { useState, useEffect } from 'react';
import './App.css';
import Form from './components/Form';

function App() {

  const [name,setName] = useState('');
  const [dob,setDob] = useState('')

  return (
    <div>
      <header>
        <h1>Birthday Remainder</h1>
      </header>
      <Form 
        name={name} 
        setName={setName} 
        dob={dob}
        setDob={setDob}
        />
        <p>{name}</p>
        <p>dob}</p>
    </div>
  );
}


export default App;
